import axios from 'axios'
import AuthenticationService from "./AuthenticationService";

const LOCALHOST = 'http://localhost:8080'
const STUDENT_URL = `${LOCALHOST}/students`


class StudentService {
    getStudentProjects() {
        const header = AuthenticationService.authHeader()
        return axios({
            method: 'get',
            header: header,
            url: `${STUDENT_URL}/projects`
        });
    }

    applyProjectById(id) {
        const header = AuthenticationService.authHeader()
        return axios({
            method: 'post',
            id: id,
            header: {
                header,
                'Access-Control-Allow-Origin': '*',
            },
            url: `https://cors-anywhere.herokuapp.com/https://${STUDENT_URL}/projects/application`
        });
    }


}

export default new StudentService();
